script: |
  super -f text -I q11425.spq | sort > q11425.out

inputs:
  - name: q11425.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE col0 NOT IN ( - col1 + col0 * col1 / tab1.col0 );
  - name: tab1

outputs:
  - name: q11425.out
    data: |
      3	26	54
      64	10	57
      80	13	96
